import React from "react";
import { Link } from "react-router-dom";
import logo from "../assets/logo.png"; // ✅ Add your logo image here

export default function Navbar() {
  return (
    <nav className="bg-white shadow-md fixed w-full top-0 left-0 z-50">
      <div className="max-w-6xl mx-auto flex justify-between items-center px-6 py-3">

        {/* ✅ Logo Section */}
        <Link to="/" className="flex items-center gap-3 group">
          <img
            src={logo}
            alt="EmbleMed Care Logo"
            className="w-15 h-11 object-contain transition-transform duration-300 group-hover:scale-110"
          />
          <div className="text-xl font-semibold text-gray-800 group-hover:text-blue-600 transition-colors duration-300">
            EmbleMed Care
          </div>
        </Link>

        {/* ✅ Navigation Links */}
        <ul className="hidden md:flex space-x-8 font-medium">
          {[
            { name: "Home", path: "/" },
            { name: "About Us", path: "/about" },
            { name: "Products", path: "/products" },
            { name: "Contact Us", path: "/contact" },
          ].map((link) => (
            <li key={link.name}>
              <Link
                to={link.path}
                className="text-gray-700 hover:text-blue-600 transition-colors duration-200 relative after:absolute after:left-0 after:-bottom-1 after:h-[2px] after:w-0 after:bg-blue-600 hover:after:w-full after:transition-all after:duration-300"
              >
                {link.name}
              </Link>
            </li>
          ))}
        </ul>

        {/* ✅ Mobile Menu Icon (for future) */}
        <div className="md:hidden">
          <button aria-label="menu" className="text-gray-700 text-2xl">
            ☰
          </button>
        </div>
      </div>
    </nav>
  );
}
